import { BrowserRouter, Route, Routes } from "react-router-dom";
import AllProducts from "./pages/frontend/AllProducts";
import Card from "./pages/frontend/Card";
import Contact from "./pages/frontend/Contact";
import NotFound from "./pages/frontend/NotFound";
import FrontendLayout from "./pages/layout/FrontendLayout";
import BackendLayout from "./pages/layout/BackendLayout";
import { FrontentAllProducts, FrontentCard, FrontentHome, FrontentNotFound } from "./pages/frontend/FrontendPagesList";



function App() {
  return (
    <BrowserRouter>
        <Routes>
            <Route path="/" element={<FrontendLayout/>}>
                <Route index element={<FrontentHome/>}/>
                <Route path="/allproducts" element={<FrontentAllProducts/>}/>
                <Route path="/card" element={<FrontentCard/>}/> 
                <Route path="/contact" element={<Contact/>}/>
                <Route path="*" element={<FrontentNotFound/>}/>
            </Route>

            <Routes path="backend" element={<BackendLayout/>}>
                <Route index element={<index/>}/>
                <Route path="contact" element={<Contact/>}/>
                <Route path="card" element={<Card/>}/>
            </Routes>

        </Routes>

    </BrowserRouter>
  );
}

export default App;
